import React from "react";
import Footer from "./footer";
import NavBar from "./nav_bar";
import Header from "./header";
import '../styles/main.css';
import Section from "./section";

function Main() {
  return (
    <div>
      <Header />
      <NavBar />
      <Section />
      <Footer />
    </div>
  );
}

export default Main;
